import React from "react";
import { BrowserRouter as Router, Route, Redirect, Switch } from "react-router-dom";
import Main from "./Pages/Main";
import PricesAndServices from "./Pages/PricesAndServices";
import WindowPage from "./Pages/WindowPage";
import Contacts from "./Pages/Contacts";
import PrivacyPolicy from "./Pages/privacyPolicyrivacyPolicy";
import NotFound from "./Pages/NotFound";

function App() {
  return (
    <Router basename="/AutoBox18/autobox/public">
      <Switch>
        <Route exact path="/">
          <Redirect to="/main" />
        </Route>
        <Route path="/main" exact>
          <Main />
        </Route>
        <Route path="/pricesAndServices" exact>
          <PricesAndServices />
        </Route>
        <Route path="/contacts" exact>
          <Contacts />
        </Route>
        <Route path="/privacyPolicy" exact>
          <PrivacyPolicy />
        </Route>
        <Route path="/pricesAndServices/:id">
          <WindowPage />
        </Route>
        <Route path="*">
          <NotFound />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
